import React from 'react';
import { HashRouter as Router, withRouter } from 'react-router-dom';
import './doctor.scss';
import { Table, Button, Input } from 'antd';
class Doctor extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      dataSource:[
        {
          key: '1',
          name: '胡彦斌',
          age: 32,
          address: '西湖区湖底公园1号',
        },
        {
          key: '2',
          name: '胡彦祖',
          age: 42,
          address: '西湖区湖底公园1号',
        },
      ],
      columns:[
        {
          title: 'Name',
          dataIndex: 'name',
          key: 'name',
        },
        {
          title: 'Gender',
          dataIndex: 'gender',
          key: 'gender',
        },
        {
          title: 'Age',
          dataIndex: 'age',
          key: 'age',
        },
        {
          title: 'Phone',
          dataIndex: 'phone',
          key: 'phone',
        },
        {
          title: 'Address',
          dataIndex: 'address',
          key: 'address',
        },
        {
          title: 'Status',
          dataIndex: 'status',
          key: 'status',

        },
      ]
    };
    this.getData = this.getData.bind(this)
  }
  componentDidMount(){
    this.getData()
  }
  getData(){
    React.$api.post('/doctor/checkPatient?doctorId='+window.localStorage.getItem('id')).then(data => {
      console.log(data);
      this.setState({
        dataSource: data
      })
    })
  }
  render() {
    return (
      <div className="doctor">
        <Input />
        <Button>Add</Button>
        <Button>Delete</Button>
        <Table columns={this.state.columns} bordered dataSource={this.state.dataSource} />
      </div>
    );
  }
}

export default withRouter(Doctor);
